function App() {
  return (
    <BrowserRouter>
<Routes>
        {/* Rutas con Navbar */}
        <Route
          path="/"element={
            <>
              <Header />
              <Ejemplo />
            </>
          }
        />
        {/* Rutas sin Navbar */}
        <Route path="/registro" element={<Registro />} />
